import React, { useState } from "react";
import "../../App.css";
import Footer from "../../components/Footer/Footer";
import NavBar from "../../components/NavBar/NavBar";
import "./ServicesPage.scss";

function ServicesPage() {
  const [image, setImage] = useState("");
  const [text, setText] = useState("");
  const [label, setLabel] = useState("");
  const [isPending, setIsPending] = useState("");

  return (
    <>
      <NavBar />
      <div className="services">
        <h1 className="services__title">Post your location</h1>
      </div>
      <h2 className="services__form-title">Enter your info here</h2>
      <form className="services__form">
        <label>Attach Picture</label>
        <input required type="file" />
        <label>Enter a short text describing an activity at the place</label>
        <input required type="text" />
        <label>Enter the type of place it is</label>
        <select>
          <option value="adventurous">Adventurous</option>
          <option value="luxurious">Luxurious</option>
          <option value="mysterious">Mysterious</option>
          <option value="fascinating">Fascinating</option>
        </select>
      </form>
      <Footer />
    </>
  );
}

export default ServicesPage;
